css:
@-moz-document domain("desmos.com") {
.dcg-btn, .dcg-btn-green {
    border: 1px solid #B76E79 !important;
    border-color: #B76E79 #B76E79 #91414D !important;
    background: linear-gradient(to bottom, #B76E79 0, #91414D 100%) !important;
    color: white !important;
    text-shadow: none;
}
.dcg-container .dcg-expression-top-bar .dcg-hide-in-edit.dcg-btn.dcg-hovered i {
    color: #eee !important;
}
.dcg-add-expression-btn .dcg-icon-caret-down {
    color: white;
    text-shadow: none;
}
.dcg-expression-top-bar {
    background: linear-gradient(to bottom, #ffe6ea 0, #dda6ae 100%) !important;
}
.dcg-settings-container .dcg-active {
    background-color: #91414D !important;
    border-color: #91414D !important;
}
.dcg-checkbox-box {
    color: #91414D !important;
}
}
